import './App.css';
import Admin from './Admin';
import React, { useState } from 'react';
import AdminLogin from './AdminLogin';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogin = () => {
    setIsLoggedIn(true);
  };

  return (
    <div className="App">
      {isLoggedIn ? <Admin /> : <AdminLogin onLogin={handleLogin} />}
    </div>
  );
}

export default App;
